class SnakeNode {
  constructor(val) {
    this.val = val;
    this.next = null;
  }
}

export class Snake {
  constructor(x, y) {
    const node = new SnakeNode({ x, y });
    this.head = node;
    this.tail = node;
  }
  moveLeft() {
    this.head.valx + 1;
    // return this.x;
  }
}
